import About from "./components/layout/About";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Slider2 from "./"

export const App = () => {
  return (
    <div>
      <Header />
      <Slider />
      <About />
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
